import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import SimularPage from './pages/Simular';
import ListagemPage from './pages/Listagem';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/simular" component={SimularPage} />
        <Route path="/listagem" component={ListagemPage} />
      </Switch>
    </Router>
  );
}

export default App;
